import {
  LineChart,
  XAxis,
  YAxis,
  CartesianGrid,
  Line,
  Tooltip,
  Legend,
} from "recharts";

const VariablesGraph = (props) => {
  const lines = [];

  // Iterirajte kroz sve dostupne nizove pored niza "time"
  Object.keys(props.variables.hourly).forEach((key) => {
    if (key !== "time") {
      // Kreirajte podatke za trenutni niz
      const data = props.variables.hourly.time.map((time, index) => ({
        x: time,
        [key]: props.variables.hourly[key][index],
      }));

      // Dodajte liniju za trenutni niz
      lines.push(
        <Line
          key={key}
          type="monotone"
          dataKey={key}
          name={key}
          data={data}
          stroke="#8884d8"
        />
      );
    }
  });

  return (
    <div style={{ display: "flex", justifyContent: "center", marginTop: "10px" }}>
      <LineChart width={1000} height={500} data={props.variables.hourly.time}>
        <XAxis dataKey="x" />
        <YAxis />
        <CartesianGrid stroke="#ccc" />
        {lines}
        <Tooltip />
        <Legend />
      </LineChart>
    </div>
  );
};

export default VariablesGraph;
